// ./src/app.js
import Buns from "./components/Buns";
import Home from "./components/Home";
import PageError from "./components/PageError";
import Wagyu from "./components/Wagyu";
import Meat from "./components/Meat";

const App = [
  {
    path: '/',
    element: <Home />,
    children: [
      {
        path: '/buns',
        element: <Buns />
      },
      {
        path: '/meat',
        element: <Meat/>,
        children:[
          {
            path: '/meat/wagyu',
            element: <Wagyu/>,
          }
        ]
      },
      {
        path: '*',
        element: <PageError />
      }
    ]
  }
];

export default App;
